window.bookSummaryJSON = "<p>A former Rogue being presented to the Fates. What could go wrong?</p> <p></p> <p>When I was offered a seat on the Ethereal Council, no one said anything about meeting the actual Fates. On the day of my presentation, not only do I offend the three women who control every single thread of life, but an Angel's thread is cut short, and no one knows how.</p> <p></p> <p>Now, it's my job to find out who did it before the death gets pinned on me, and starts an all-out Angel-Demon war.</p> <p></p> <p>Maybe being a Rogue was the least of my problems.</p> <p></p> <p>Lady of Madness &amp; Moonlight is the third book in the Rogue Ethereal series. If you enjoy foul-mouthed heroines, dark humor, and enemies-to-lovers, then you'll love this series.</p>"; 
